import React from 'react';


function Button (props){
    
    return(
        <React.Fragment>
           
                <button 
                    className=""
                    onClick = {(event)=>props.onclick(event)}
                    title = {props.title}
                    type = {props.type}
                    tabIndex = {props.type}
                >    
                        {props.name} 

                </button>

        </React.Fragment>
    )
}

export default Button
